		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (1,1,'Comunicazione della decisione di non aggiudicare l''appalto','Viene inviata a tutte le ditte in gara',50.00,'1','Comunicazione di non aggiudicazione','con la presente si informano i concorrenti che codesta amministrazione non intende procedere con l''aggiudicazione dell''appalto che è da ritenersi annullato.',null,0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (2,1,'Comunicazione dell''esclusione alle ditte candidate','Viene inviata alle ditte escluse nella fase di ''Ricezione plichi'' o in una fase precedente',2.00,'1','Esclusione dalla gara','con la presente si comunica l''esclusione dalla procedura di gara.','ditg.ammgar = ''2'' and ditg.fasgar <= 1',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (3,1,'Comunicazione dell''esclusione alle ditte offerenti','Viene inviata alle ditte escluse in una fase successiva a quella di ''Ricezione plichi''',3.00,'1','Esclusione dalla gara','con la presente si comunica l''esclusione dalla procedura di gara.','ditg.ammgar = ''2'' and ditg.fasgar > 1 and ditg.fasgar <= 6',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (4,1,'Comunicazione della richiesta documenti per comprova requisiti alla ditta aggiudicataria','Viene inviata alla ditta aggiudicataria provvisoria',4.00,'1','Richiesta documenti per comprova requisiti','facendo seguito all''aggiudicazione provvisoria della gara, con la presente si richiede di presentare la documentazione necessaria per la comprova del possesso dei requisiti di ordine generale, nonché della capacità economico-finanziaria e tecnico/organiz.','ditg.staggi = 4',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (5,1,'Comunicazione della richiesta documenti per comprova requisiti alla ditta seconda in graduatoria','Viene inviata alla ditta seconda aggiudicataria provvisoria',5.00,'1','Richiesta documenti per comprova requisiti','facendo seguito all''aggiudicazione provvisoria della gara, con la presente si richiede di presentare la documentazione necessaria per la comprova del possesso dei requisiti di ordine generale, nonché della capacità economico-finanziaria e tecnico/organiz.','ditg.staggi = 5',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (6,2,'Comunicazione dell''aggiudicazione definitiva alla ditta aggiudicataria','Viene inviata alla ditta aggiudicataria definitiva',6.00,'1','Aggiudicazione definitiva','a seguito dell''espletamento della procedura di appalto, si comunica che l''appalto è stato aggiudicato in via definitiva a codesta ditta.','exists (select gare.ngara from gare where gare.ngara=ditg.ngara5 and ditg.dittao = gare.ditta)',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (7,2,'Comunicazione dell''aggiudicazione definitiva e dello svincolo della cauzione provvioria alle ditte non aggiudicatarie','Viene inviata alle ditte non aggiudicatarie',7.00,'1','Aggiudicazione definitiva e svincolo cauzione provvisoria','a seguito dell''espletamento della procedura di appalto, si comunica l''avvenuta aggiudicazione definitiva e pertanto codesta ditta può ritenere svincolata la propria cauzione provvisoria.','(ditg.ammgar is null or ditg.ammgar <> ''2'') and not exists (select gare.ngara from gare where gare.ngara=ditg.ngara5 and (ditg.dittao = gare.ditta or gare.ditta is null))',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (8,2,'Comunicazione della data di avvenuta stipulazione del contratto alla ditta aggiudicataria','Viene inviata alla ditta aggiudicataria definitiva',8.00,'1','Data di avvenuta stipulazione del contratto','con la presente si comunica che il contratto per la procedura d''appalto è stato stipulato con data __________','exists (select gare.ngara from gare where gare.ngara=ditg.ngara5 and ditg.dittao = gare.ditta)',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (9,2,'Comunicazione della data di avvenuta stipulazione del contratto alle ditte non aggiudicatarie','Viene inviata alle ditte non aggiudicatarie',9.00,'1','Data di avvenuta stipulazione del contratto','con la presente si comunica che il contratto per la procedura d''appalto è stato stipulato con data __________ con la ditta _________','(ditg.ammgar is null or ditg.ammgar <> ''2'') and not exists (select gare.ngara from gare where gare.ngara=ditg.ngara5 and (ditg.dittao = gare.ditta or gare.ditta is null))',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (10,3,'Comunicazione dell''aggiudicazione definitiva','Viene inviata alle ditte che non sono state escluse dalla gara',6.00,'1','Aggiudicazione definitiva','a seguito dell''espletamento della procedura di appalto, si comunica l''esito della stessa e l''aggiudicazione definitiva dei vari lotti.','(ditg.ammgar is null or ditg.ammgar <> ''2'')',0);
		INSERT INTO W_CONFCOM (NUMPRO,GENERE,MODTIT,MODDESC,NUMORD,COMINTEST,COMMSGOGG,COMMSGTES,FILTROSOG,CRITTES) VALUES (11,3,'Comunicazione della data di avvenuta stipulazione del contratto','Viene inviata alle ditte che non sono state escluse dalla gara',7.00,'1','Data di avvenuta stipulazione del contratto','con la presente si comunica la stipula del contratto in data _________  per i lotti _______ della procedura d''appalto.','(ditg.ammgar is null or ditg.ammgar <> ''2'')',0);
