-- AGGIORNAMENTO SITAT/VIGILANZA
-- Database: DB2
-- Versione: 2.8.0 --> 2.8.1
------------------------------

create procedure aggiorna ()
begin

	Declare v_sql varchar(5000);
	Declare v_max varchar(10);

	IF (select count(*) from eldaver where codapp='W9' and (numver='2.8.0' or numver like '2.8.0.%'))=1
	THEN
	
		
		Delete from W_OGGETTI where TIPO='FUNZ' and OGGETTO IN ('DEL.W9.ListaCentri.DEL','DEL.W9.ListaCentri.LISTADELSEL''INS.W9.ListaCentri.LISTANUOVO','INS.W9.SchedaCentri.SCHEDANUOVO','INS.W9.TrovaCentri.TROVANUOVO','MOD.W9.ListaCentri.MOD','MOD.W9.SchedaCentri.SCHEDAMOD');
		Delete from W_OGGETTI where TIPO='MASC' and OGGETTO IN ('W9.ListaCentri','W9.SchedaCentri','W9.TrovaCentri');
		Delete from W_OGGETTI where TIPO='SEZ' and OGGETTO ='W9.W9LOTT-scheda.DATIDET.MODLAV';

		
		UPDATE W9FASI F SET F.ID_SCHEDA_LOCALE = (
			SELECT l.CIG || '_' || CAST(F.FASE_ESECUZIONE as CHAR(3))  || '_' || CAST(F.NUM as CHAR(3))
				FROM W9LOTT L WHERE L.CODGARA=F.CODGARA AND L.CODLOTT=F.CODLOTT AND F.ID_SCHEDA_LOCALE IS NULL AND F.ID_SCHEDA_SIMOG IS NULL) 
			WHERE F.ID_SCHEDA_LOCALE IS NULL AND F.ID_SCHEDA_SIMOG IS NULL;
		
		UPDATE W9LOTT SET ID_SCHEDA_LOCALE = CIG WHERE ID_SCHEDA_LOCALE IS NULL AND ID_SCHEDA_SIMOG is null;
		
		Update ELDAVER set NUMVER='2.8.1', DATVET=CURRENT_TIMESTAMP where CODAPP='W9';

		commit;
		
	END IF;
end@

call aggiorna@
drop procedure aggiorna@

